import React from "react";
import "./Book.css";

const book = (props) => {
  // console.log(props.result);
  return (
    <div className="Book">
      <React.Fragment>
        <h3>{props.result[0]}</h3>
        <p>{props.result[1].substr(0, 150)}...</p>
        <hr></hr>
        <label>{props.result[2]}</label>
      </React.Fragment>
    </div>
  );
};

export default book;
